- input: "TEXT\x1CC00252551\x1C.TEXT\x1C\x1CF3XA\x1CItems 42193/40410 is an inkind
    contribution from the Chargers Football Company for the use of a suite and parking
    as appreciation gifts to our volunteers. Before this transaction, the escrow balance
    was $7,759.76. This is then reduced by the federal share ($12,000 X 36% = $4,320)
    leaving a new escrow balance of $3,439.76. Items 42196/40412 & 42197/40414 are
    inkind contributions from C. Terry Brown for for lodging for our volunteers. Before
    this transaction, the escrow balance was $3,439.76. This balance is then reduced
    by the federal share ($3,270 X 36% = $1,177.20) leaving a new escrow balance of
    $2,262.56. Items 42199/40489, 42201/40727, and 42203/40731 are inkind contributions
    from Phil's BBQ, Studio Diner and Anthony's for food and beverages for our volunteers.
    Before this transaction, the escrow balance was $2,262.56. This is then reduced
    by the federal share ($2,093 X 36% = $753.48) leaving a new escrow balance of
    $1,509.08. Items 42205/40492 & 42207/40565 are inkind contributions from Harbor
    Town Pub and Cafe Cayote for food and beverages for our volunteers. Before these
    transactions, the escrow balance was $1,509.08. This is then reduced by the federal
    shares ($500+$1,500)* X 36% = $720) leaving a new escrow balance of $789.08.\n"
